  .trade-market-index-container.trade-market .market-symbol .grid_tbody {
    height: 723px;
  }
  .en_US .trade-market-index-container.trade-market .market-symbol .grid_tbody {
    height: 735px;
  }
  /deep/.spot-search {
    border: none;
    .iconbox {
      display: none;
    }
    .clones {
      display: none;
    }
    input {
      height: 28px;
      line-height: 28px;
      color: RGB(167, 180, 203);
    }
  }
	.symbol-item {
		border-bottom: 1px solid rgb(167, 180, 203);
		padding: 0 15px !important;
		box-sizing: border-box;
		background-color: #fff;
		display: flex;
		align-items: center;
		.td-symbol {
			font-size: 14px;
			font-weight: 600;
			color: rgb(22, 22, 31);
		}
		.td-price {
			line-height: 19px !important;
			.td-price-1 {
				font-size: 14px;
				font-weight: 600;
				color: rgb(22, 22, 31);
				line-height: 14px !important;
			}
			.td-price-2 {
				font-size: 12px;
				font-weight: 600;
				color: rgb(167, 180, 203);
				line-height: 14px !important;
			}
		}
		.td-rose {
			font-weight: 700;
			font-size: 14px;
		}
	}
  .input-box {
    width: 326px;
    height: 36px;
    border-radius: 18px;
    display: flex;
    align-items: center;
    padding-left: 16px;
    padding-right: 16px;
    box-sizing: border-box;
    background-color: #fff;
    margin-bottom: 30px;
    img {
      width: 24px;
      height: 24px;
      margin-right: 16px;
    }
  }
  .left-content {
    height: 1157px;
    border-radius: 10px;
    background-color: #fff;
    .coin-tabs {
      display: flex;
      margin-bottom: 19px;
      .coin-item {
        width: 50%;
        height: 45px;
        line-height: 45px;
        text-align: center;
        background-color: rgba(167, 180, 203, .1);
        font-size: 14px;
        font-weight: 700;
        color: #16161F;
        cursor: pointer;
        &:first-child {
          border-top-left-radius: 10px;
        }
        &:last-child {
          border-top-right-radius: 10px;
        }
        &.active {
          background-color: #fff;
          color: #1269FF;
          border-bottom: 1px solid rgba(167, 180, 203, .1);
        }
      }
    }
    .coin-container {
      height: calc(100% - 65px);
      background-color: #fff;
      border-radius: 10px;
    }
  }
